--images as base64 encoded strings
flamingo = ""
snowdrop = ""

function onCycle()
	photographer_number = math.random(1000000000, 9999999999)
	photographer_id = "photographer-"..photographer_number
	product_id = math.random(1000000, 9999999)
	category_id = math.random(1, 6)
	category_name = "category-"..category_id
end

function registerPhotographer(id, number)
  return "[POST]{\"schema\": \"com.nordstrom/user-info/update-phone/1-0-0\", \"id\": \""..id.."\", \"phone\": \""..number.."\", \"origin\": \"hello-retail/httploadgenerator/dummy_id/dummy_name\"}URLAPIEVENTWRITERPLACEHOLDER"
end

function newProduct(id, category, name, brand, description)
  return "[POST]{\"schema\": \"com.nordstrom/product/create/1-0-0\", \"id\": \""..id.."\", \"origin\": \"hello-retail/httploadgenerator/dummy_id/dummy_name\", \"category\": \""..category.."\", \"name\": \""..name.."\", \"brand\": \""..brand.."\", \"description\": \""..description.."\"}URLAPIEVENTWRITERPLACEHOLDER"
end

function listCategories()
  return "URLAPIPRODUCTCATALOGCATEGORIESPLACEHOLDER"
end

function listProductsByCategory(category)
	return "URLAPIPRODUCTCATALOGPRODUCTSPLACEHOLDER?category="..category
end

function listProductsByID(id)
	return "URLAPIPRODUCTCATALOGPRODUCTSPLACEHOLDER?id="..id
end

function commitPhoto(ph_id, ph_number, prod_id, image_64_encode)
	return "[POST]{\"photographer\": {\"id\": \""..ph_id.."\", \"phone\": \""..ph_number.."\"}, \"For\": \""..prod_id.."\", \"Media\": \""..image_64_encode.."\"}URLAPIPHOTORECEIVEPLACEHOLDER"
end

function onCall(callnum)
	if callnum == 1 then	--registerPhotographer POST
		return registerPhotographer(photographer_id, photographer_number)
	elseif callnum == 2 then	--newProduct POST
		return newProduct(product_id, category_name, "name-"..product_id, "brand-"..product_id, "description-"..product_id)
	elseif callnum == 3 then  --listCategories GET
		return listCategories()
	elseif callnum == 4 then  --listProductsByCategory GET
		return listProductsByCategory(category_name)
	elseif callnum == 5 then  --listProductsByID GET
		return listProductsByID(product_id)
	elseif callnum == 6 then  --commitPhoto POST
		if math.random(2) == 1 then
			return commitPhoto(photographer_id, photographer_number, product_id, flamingo)
		else
			return commitPhoto(photographer_id, photographer_number, product_id, snowdrop)
		end
	else
		return nil;
	end
end
